s like Hoppo, Deano, Reidy, Jesse, Maxy, Whippet and Harries, as they catch thieves, perform CPR, make drug busts, break up fights, and even handle a navy bomb that washes ashore one afternoon. Every year throws up new and completely unexpected challenges, and how lifeguards adapt is what makes Bondi Rescue a show thats about much more than swimmers being saved in the surf.\n\nBest Rescues - http://bit.ly/bestrescues\nClose Calls and Near Deaths - https://bit.ly/2RBd3Z1\nWorst Injuries - http://bit.ly/worstinjuries\nHilarious Moments - http://bit.ly/hilariousevents\nBest Goofs - http://bit.ly/bestgoof\nBondis Lifeguards - http://bit.ly/bondilifeguards\nSaving Kids - http://bit.ly/lostonbeach\nThieves and Perverts - http://bit.ly/thievesandperverts\nCrazy Animal Encounters - http://bit.ly/bondicrazyanimals\nFamous People - http://bit.ly/famouspeople\n\nFACEBOOK - https://www.facebook.com/BondiRescueTV\nINSTAGRAM - https://www.instagram.com/bondirescuetv/\nTWITTER - https://twitter.com/bondirescue\nITUNES - http://ow.ly/aDVRz \nWEBSITE - http://www.cjz.com.au\nMERCH STORE - https://teespring.com/stores/bondi-rescue Your favourite lifeguards are back!\n\nBondi Rescue follows the work of the elite professional Lifeguards who patrol Australias busiest beach. This is Australias real life Baywatch! Taking the viewers on their journey through mass rescues, drownings, resuscitations, shark sightings, and all number of the weird and wonderful experiences Bondi Beach dishes up. \n\nIn Bondi Rescue the audience sees the action through the eyes of real characters and lifeguards like Hoppo, Deano, Reidy, Jesse, Maxy, Whippet and Harries, as they catch thieves, perform CPR, make drug busts, break up fights, and even handle a navy bomb that washes ashore one afternoon. Every year throws up new and completely unexpected challenges, and how lifeguards adapt is what makes Bondi Rescue a show thats about much more than swimmers being saved in the surf.\n\n- Watch More - \nBest of Bondi es of real characters and lifeguards like Hoppo, Deano, Reidy, Jesse, Maxy, Whippet and Harries, as they catch thieves, perform CPR, make drug busts, break up fights, and even handle a navy bomb that washes ashore one afternoon. Every year throws up new and completely unexpected challenges, and how lifeguards adapt is what makes Bondi Rescue a show thats about much more than swimmers being saved in the surf.\n\nBest Rescues - http://bit.ly/bestrescues\nClose Calls and Near Deaths - https://bit.ly/2RBd3Z1\nWorst Injuries - http://bit.ly/worstinjuries\nHilarious Moments - http://bit.ly/hilariousevents\nBest Goofs - http://bit.ly/bestgoof\nBondis Lifeguards - http://bit.ly/bondilifeguards\nSaving Kids - http://bit.ly/lostonbeach\nThieves and Perverts - http://bit.ly/thievesandperverts\nCrazy Animal Encounters - http://bit.ly/bondicrazyanimals\nFamous People - http://bit.ly/famouspeople\n\nFACEBOOK - https://www.facebook.com/BondiRescueTV\nINSTAGRAM - https://www.instagram.com/bondirescuetv/\nTWITTER - https://twitter.com/bondirescue\nITUNES - http://ow.ly/aDVRz \nWEBSITE - http://www.cjz.com.au\nMERCH STORE - https://teespring.com/stores/bondi-rescue Your favourite lifeguards are back!\n\nBondi Rescue follows the work of the elite professional Lifeguards who patrol Australias busiest beach. This is Australias real life Baywatch! Taking the viewers on their journey through mass rescues, drownings, resuscitations, shark sightings, and all number of the weird and wonderful experiences Bondi Beach dishes up. \n\nIn Bondi Rescue the audience sees the action through the eyes of real characters and lifeguards like Hoppo, Deano, Reidy, Jesse, Maxy, Whippet and Harries, as they catch thieves, perform CPR, make drug busts, break up fights, and even handle a navy bomb that washes ashore one afternoon. Every year throws up new and completely unexpected challenges, and how lifeguards adapt is what makes Bondi Rescue a show thats about much more than swimmers being saved in the surf
